import React, { useState } from 'react';
import { Bot, Building2, Utensils, Bell, LogOut, CheckCircle, Activity } from 'lucide-react';

const initialPortfolio = [
  { 
    name: '◊ï◊ô◊ú◊î ◊ô◊ï◊ß◊®◊™◊ô◊™ - ◊ß◊ô◊°◊®◊ô◊î', 
    rooms: [{ id: 'K1', name: '◊°◊ï◊ï◊ô◊ò◊™ ◊û◊ê◊°◊ò◊®', status: '◊™◊§◊ï◊°', guest: '◊û◊©◊§◊ó◊™ ◊ê◊î◊®◊ï◊†◊ô' }] 
  },
  { 
    name: '◊§◊†◊ò◊î◊ê◊ï◊ñ ◊®◊ï◊ò◊©◊ô◊ú◊ì - ◊™"◊ê', 
    rooms: [{ id: 'T1', name: '◊°◊ï◊ï◊ô◊ò◊™ ◊§◊®◊ô◊û◊ô◊ï◊ù', status: '◊™◊§◊ï◊°', guest: 'John Doe' }] 
  }
];

function App() {
  const [portfolio, setPortfolio] = useState(initialPortfolio);
  const [aiLog, setAiLog] = useState(["◊û◊¢◊®◊õ◊™ AI ◊û◊ï◊õ◊†◊î ◊ú◊§◊¢◊ï◊ú◊î..."]);
  const [showSummary, setShowSummary] = useState(false);

  const sendToAI = async (type, roomName, propName) => {
    const timestamp = new Date().toLocaleTimeString();
    let actionDesc = "";
    
    if (type === 'checkout') actionDesc = `◊¶'◊ß-◊ê◊ê◊ï◊ò ◊ë${roomName}: ◊î◊ñ◊†◊ß◊™ ◊¶◊ï◊ï◊™ ◊†◊ô◊ß◊ô◊ï◊ü.`;
    if (type === 'towels') actionDesc = `◊ë◊ß◊©◊î ◊ú◊û◊í◊ë◊ï◊™ ◊ë${roomName}: ◊¢◊ï◊ì◊õ◊ü ◊û◊©◊ß ◊ë◊ô◊™.`;
    if (type === 'restaurant') actionDesc = `◊î◊ñ◊û◊†◊™ ◊©◊ï◊ú◊ó◊ü ◊û${roomName}: ◊ë◊ï◊¶◊¢ ◊®◊ô◊©◊ï◊ù ◊ë◊û◊°◊¢◊ì◊î.`;

    setAiLog(prev => [`[${timestamp}] ${actionDesc}`, ...prev.slice(0, 4)]);

    try {
      await fetch('http://127.0.0.1:5000/ai_action', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ type, room: roomName, property: propName }),
      });
    } catch (e) {
      console.log("AI Server offline, but action logged locally.");
    }
  };

  return (
    <div style={{ padding: '30px', backgroundColor: '#020617', color: 'white', minHeight: '100vh', direction: 'rtl', fontFamily: 'Segoe UI' }}>
      
      {/* Header */}
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px', borderBottom: '1px solid #1e293b', paddingBottom: '20px' }}>
        <h1 style={{ color: '#3b82f6', margin: 0, display: 'flex', alignItems: 'center', gap: '10px' }}>
          <Bot size={35} /> ◊†◊ô◊î◊ï◊ú ◊ë◊ô◊†◊î ◊û◊ú◊ê◊õ◊ï◊™◊ô◊™ ◊©◊ú LuxuryStay
        </h1>
        <div style={{ display: 'flex', gap: '15px', alignItems: 'center' }}>
          <button onClick={() => setShowSummary(true)} style={{ background: '#10b981', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '8px', cursor: 'pointer', fontWeight: 'bold' }}>
             üìä ◊ì◊ï"◊ó ◊°◊ô◊õ◊ï◊ù ◊ô◊ï◊û◊ô
          </button>
          <div style={{ textAlign: 'left' }}>
            <span style={{ color: '#10b981' }}>‚óè ◊û◊¢◊®◊õ◊™ ◊û◊ß◊ï◊ï◊†◊™</span>
            <div style={{ fontSize: '0.8em', color: '#64748b' }}>◊û◊ó◊ï◊ë◊® ◊ú-Airbnb API</div>
          </div>
        </div>
      </div>

      {/* AI Live Log */}
      <div style={{ background: '#0f172a', border: '1px solid #3b82f6', padding: '15px', borderRadius: '12px', marginBottom: '30px' }}>
        <h4 style={{ margin: '0 0 10px 0', color: '#3b82f6' }}>üìü ◊ô◊ï◊û◊ü ◊§◊¢◊ï◊ú◊ï◊™ AI (◊ë◊ñ◊û◊ü ◊ê◊û◊™):</h4>
        {aiLog.map((log, i) => (
          <div key={i} style={{ fontSize: '0.9em', color: i === 0 ? '#fff' : '#64748b', marginBottom: '5px' }}>{log}</div>
        ))}
      </div>

      {/* Properties List */}
      {portfolio.map((prop, pIdx) => (
        <div key={pIdx} style={{ marginBottom: '30px', background: '#1e293b', padding: '25px', borderRadius: '20px' }}>
          <h2 style={{ marginBottom: '20px', display: 'flex', alignItems: 'center', gap: '10px' }}>
            <Building2 color='#3b82f6' /> {prop.name}
          </h2>
          {prop.rooms.map((room, rIdx) => (
            <div key={rIdx} style={{ background: '#0f172a', padding: '20px', borderRadius: '15px', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <div>
                <h4 style={{ margin: '0 0 5px 0' }}>{room.name}</h4>
                <div style={{ fontSize: '0.85em', color: '#94a3b8' }}>◊ê◊ï◊®◊ó: {room.guest}</div>
              </div>
              <div style={{ display: 'flex', gap: '15px' }}>
                <button onClick={() => sendToAI('checkout', room.name, prop.name)} style={btnStyle('#ef4444')}><LogOut size={16} /> ◊ô◊¶◊ô◊ê◊î</button>
                <button onClick={() => sendToAI('towels', room.name, prop.name)} style={btnStyle('#f59e0b')}><Bell size={16} /> ◊û◊í◊ë◊ï◊™</button>
                <button onClick={() => sendToAI('restaurant', room.name, prop.name)} style={btnStyle('#10b981')}><Utensils size={16} /> ◊û◊°◊¢◊ì◊î</button>
              </div>
            </div>
          ))}
        </div>
      ))}

      {/* Summary Modal */}
